INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-08-07 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:26:26.337153', 'iz9zvkE_Tl2L8TTt-1sWPg', 'Xl-TssL8TEGM4ZBeEu-HyQ', '2016-11-14 01:26:26.337153', 'My fingers are long and beautiful, as, it has been well been documented, are various other parts of my body.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-08-07 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:26:51.260406', 'aQvrFIBLRDamUkYrNxEEBA', 'tcTgmw-LQ92JWJ4_Xv4f4Q', '2016-11-14 01:26:51.260406', 'In life you have to rely on the past, and that''s called history.');
