INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2014-09-14 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:29:02.546384', 'rkVCVSP-Q9KctbOOe8hwxg', '65loBIbwT5--nLP33XeO5Q', '2016-11-14 01:29:02.546384', 'Money was never a big motivation for me, except as a way to keep score.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('1999-11-01 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:30:25.277196', 'y3vcRU-1TcuzVb7NHMKq4g', 'a1IYoLsySD2YWBI1jKkkog', '2016-11-14 01:30:25.277196', 'I think the only difference between me and other candidates is that I''m more honest and my women are more beautiful.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-08-02 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:31:24.552661', 'pUkixqdKTPGSC1nBAt0pnQ', 'u70q4vHMSZCQMfmyoox2gg', '2016-11-14 01:31:24.552661', 'You could see there was blood coming out of her eyes. Blood coming out of her... wherever.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2011-03-01 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:32:43.964607', '3sHUM84pRGaSj4ylS7a9wA', 'tZziudITRsWV5KcbMBKuMg', '2016-11-14 01:32:43.964607', 'I dealt with Gaddafi. I rented him a piece of land. He paid me more for one night than the land was worth for two years, and then I didn''t let him use the land. That''s what we should be doing. I don''t want to use the word ''screwed'', but I screwed him. That''s what we should be doing.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2006-03-01 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:34:31.424941', 'Js5AQrOsQxmjLrq5F_Os2w', 'Zdnfj6HaRKqDTDb8zze0jw', '2016-11-14 01:34:31.424941', 'I don''t think Ivanka would do that inside the magazine. Although she does have a very nice figure. I''ve said that if Ivanka weren''t my daughter, perhaps I would be dating her.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-12-01 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:35:31.341399', 'fN9CBVnYRUO8B30gzsECrg', 'uaxxGTXuTq-PC4uTelD5bA', '2016-11-14 01:35:31.341399', 'Donald J. Trump is calling for a complete and total shutdown of Muslims entering the United States until our country''s representatives can figure out what the hell is going on.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('1997-11-24 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:37:28.288027', 'NBSpilsPQiCLXmCnH1GjOQ', 'ORNK4SEvTyCmo_1i_erIvg', '2016-11-14 01:37:28.288027', 'Women have one of the great acts of all time. The smart ones act very feminine and needy, but inside they are real killers. The person who came up with the expression ''the weaker sex'' was either very naive or had to be kidding. I have seen women manipulate men with just a twitch of their eye -- or perhaps another body part.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-04-28 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:39:15.507289', 'c0D_6QSvTdC8t95ALENRBg', 'tGNg3X1oQ3OqM1veHFT48g', '2016-11-14 01:39:15.507289', 'Our great African American President hasn''t exactly had a positive impact on the thugs who are so happily and openly destroying Baltimore!');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2012-08-28 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:41:18.293741', 'TMLQtM3wTXmh6gyZ4pLjVw', 'mGYtklJvTMSL1l11ASgSBw', '2016-11-14 01:41:18.293741', 'Arianna Huffington is unattractive both inside and out. I fully understand why her former husband left her for a man- he made a good decision.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2015-09-11 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:45:51.978031', 'Il_bY0K2QkWWaQIQHzcCtw', 'WoICO4WFRxC5f5qiwfMbiA', '2016-11-14 01:45:51.978031', 'I think apologizing''s a great thing, but you have to be wrong. I will absolutely apologize, sometime in the hopefully distant future, if I''m ever wrong.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2012-08-06 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 02:07:54.408994', '5i2eEJzdS9a0daHLzQheqw', 'DusNnKwsQWu-osffgzgO_A', '2016-11-14 02:07:54.408994', 'An ''extremely credible source'' has called my office and told me that Barack Obama''s birth certificate is a fraud.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2012-10-28 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 02:09:09.776910', 'gOhrjcoVRpO7MXbmkfBfgA', 'UexErymQTOSoY9BGiI13Ew', '2016-11-14 02:09:09.776910', 'While Bette Midler is an extremely unattractive woman, I refuse to say that because I always insist on being politically correct.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2014-09-21 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 02:14:44.540129', 'PAmSP9E5RA2oe_wVztQYuw', 'TYZCNUEAQH2m5sZGOnI1iw', '2016-11-14 02:14:44.540129', 'I mean, we could say politically correct that look doesn’t matter, but the look obviously matters ... Like you wouldn’t have your job if you weren’t beautiful.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('1991-01-01 00:00:00.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-14 01:57:01.931191', 'fIr5f4N1QdewHoTiohADdQ', 'OCiEVxhBR4Ommcu1VPtQgg', '2016-11-14 23:15:20.892951', 'You know, it doesn''t really matter what they write as long as you''ve got a young and beautiful piece of ass.');
INSERT INTO public.quote (appeared_at, author_id, created_at, quote_id, quote_source_id, updated_at, value) VALUES ('2016-06-26 22:15:40.000000', 'wVE8Y7BoRKCBkxs1JkqAvw', '2016-11-20 01:30:51.752866', 'euKVPx1FTSmkpnbPGTB18w', 'CDUrW0fDQj-o-ljz4wN_PQ', '2016-11-20 01:30:51.752866', 'Crooked Hillary Clinton got Brexit wrong. I said LEAVE will win. She has no sense of markets and such bad judgement. Only a question of time');
